Desc:
Remember Monica, the sexy Argentinean schoolgirl? The Argentinean Adventure isn\'t over yet. The Bang Bus Time Machine is taking you back again to bring you the prequel to Monica, Christina. Cruising the town, Dirty comes across this sexy honey and offers her twenty pesos for twenty questions. When it comes to money, everyone speaks the same language. As soon as Dirty brings out the dollars, Christina opens up. . . her legs that is!! Ramone doesn\'t miss a beat. He\'s all over her, tearing it up!
